        &#10094;
      </a>
      <ul class="slider__slides">
        <li className="slider__first-list-item">Plaid Me</li>
        <li className="slider__second-list-item" />
        <li className="slider__third-list-item" />
        <li className="slider__fourth-list-item" />
      </ul>
    </div>
  );
}

export default Slider
